import { useState } from 'react';
import PcWindow from '../pcWindow/pcWindow';
import Gear from '../gear/gear';

const WebService = (): JSX.Element => {

    const gear = <div className="webService__gearWrapper"><Gear classNameAdded=""/></div>

    return (
        <div className="webService">
            <div className="webService__textWrapper">
                <span>Do you need help with builidng your website? </span>
                <span>We build can build your website using different technologies such as PHP or React.</span> 
            </div>
            {/* <div className="webService__windowWrapper">
                <PcWindow elements={gear}/>
            </div> */}
        </div>
    );
}

export default WebService;
